import zlib
from base64 import b85decode
def gen():
    charset = string.ascii_lowercase + string.digits
    for _ in range(0, 10**5):
        yield ''.join([choice(charset) for _ in range(randint(4, 8))])
    yield "password"
    yield "p4ssword"
    yield "123456"
    yield "cubos"

    for x in zlib.decompress(b85decode(common)).decode('utf8').split('\n'):
        yield x
    
n = int(input())
hashes = dict()
result = list()
for i in range(n):
    hashes[input()] = i
    result.append("")

found_count = 0
for s in gen():
    m = hashlib.sha1()
    m.update(s.encode("utf8"))
    digest = m.hexdigest()
    if digest in hashes:
        result[hashes[digest]] = s
        if found_count == n:
            break

for s in result:
    print(s)
